import React, { useState, useEffect } from 'react';
import axios from 'axios';

function Timeline() {
  const [characterDetails, setCharacterDetails] = useState(null);

  useEffect(() => {
    axios.get('https://genshinlist.com/api/characters')
      .then(response => {
        const dilucCharacter = response.data.find(character => character.name === 'Diluc');
        if (dilucCharacter) {
          setCharacterDetails(dilucCharacter);
          console.log('Character Details:', dilucCharacter); // Added console log
        } else {
          console.log('Character not found');
        }
      })
      .catch(error => {
        console.log(error);
      });
  }, []);

  return (
    <div className='page' style={{ backgroundColor: '#192536', color: 'white', padding: '20px', margin: '0'}}>
     Timeline
      <h2 style={{ fontSize: '1rem', margin: '0' }}>Character Details: Diluc</h2>
      {characterDetails && (
        <div>
          <h3 style={{ fontSize: '1rem', margin: '0' }}>{characterDetails.name}</h3>
          <p style={{ fontSize: '1rem', margin: '0' }}><strong>Gender:</strong> {characterDetails.gender}</p>
          <p style={{ fontSize: '1rem', margin: '0' }}><strong>Birthday:</strong> {characterDetails.birthday}</p>
          <p style={{ fontSize: '1rem', margin: '0' }}><strong>Rarity:</strong> {characterDetails.rarity}</p>
          <p style={{ fontSize: '1rem', margin: '0' }}><strong>Vision:</strong> {characterDetails.vision}</p>
          <p style={{ fontSize: '1rem', margin: '0' }}><strong>Weapon:</strong> {characterDetails.weapon}</p>
        </div>
      )}
    </div>
  );
}

export default Timeline;
